import ctaData from '../mockData/ctaData';

const Cta = () => {
  return (
    <section className="cta-section">
      <h2 className="cta-title">{ctaData.title}</h2>
      <a href={ctaData.linkHref} className="cta-button">
        {ctaData.buttonText}
      </a>
    </section>
  );
};

export default Cta;
